import React, { useState } from "react";
import { Navbar, Nav, Container, Button, Modal } from "react-bootstrap";
import "./landingPage.css";
import { accounts } from "../modules/accountData.js";

export default function LandingPage() {
  const [logIn, setLogIn] = useState(false);

  const hideLoginModal = () => {
    setLogIn(false);
  };
  const showLoginModal = () => {
    setLogIn(true);
  };

  return (
    <div className="page">
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">
            <img
              src="https://media-exp1.licdn.com/dms/image/C4D0BAQG81bcDnvsNGQ/company-logo_200_200/0/1519934768980?e=2159024400&v=beta&t=z_pYRiNIoMIaIbBXWZs7tjIBhctAXIjB26BUGXF7cUU"
              height="50px"
            />
            Precise Financial Systems
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#about">About</Nav.Link>
              <Nav.Link href="https://thepfs.biz/">Company Website</Nav.Link>
              <Nav.Link href="#findUs">Find Us</Nav.Link>
            </Nav>
            <Button
              variant="outline-primary"
              style={{ float: "right" }}
              onClick={showLoginModal}
            >
              Login
            </Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Modal show={logIn} onHide={handleClose}>
        <Modal.Header closeButton>
          <Modal.Title>Modal heading</Modal.Title>
        </Modal.Header>
        <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={handleClose}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>

      <div className="content">
        <h1>Welcome to PFS</h1>
      </div>
    </div>
  );
}
